// src/components/About.js
import React from 'react';
import './About.css';

function About() {
  return (
    <section className="about-section">
      <h2>About Us</h2>
      <p>
        UNSW PsychSoc is dedicated to creating a supportive and engaging environment for all UNSW Psychology students and enthusiasts. 
        Our mission is to foster a sense of community, provide valuable resources, and support personal and professional growth among our members.
      </p>
      <p>
        From educational events to social gatherings, we aim to bring together students who are passionate about psychology 
        and provide opportunities to connect, learn, and grow. Join us and be a part of an exciting journey through the world of psychology!
      </p>
    </section>
  );
}

export default About;
